import "./App.css";
import { Button } from "antd";
import "antd/dist/reset.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div>
          <p>Upload Transactions(CSV)</p>
          <Button>Upload Transactions</Button>
        </div>
      </header>
    </div>
  );
}

export default App;
